class Solution {
    func minOperations(_ nums: [Int], _ target: Int) -> Int {
        var count = [Int: Int]()
        var total = 0
        for num in nums {
            count[num, default: 0] += 1
            total += num
        }
        if total < target { return -1 }
        if total == target { return 0 }

        var ops = 0
        var needed = target
        for power in stride(from: 30, through: 0, by: -1) {
            let val = 1 << power
            while needed >= val, let cnt = count[val], cnt > 0 {
                needed -= val
                count[val]! -= 1
                if needed == 0 { return ops }
                if val > 1 {
                    let half = val >> 1
                    count[half, default: 0] += 2
                    ops += 1
                }
            }
        }
        return needed == 0 ? ops : -1
    }
}
